import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme, CssBaseline } from '@mui/material';
import Navbar from './components/Navbar';
import Login from './pages/Login';
import Register from './pages/Register';
import Home from './pages/Home';
import JobDetails from './pages/JobDetails';
import Questions from './pages/Questions';
import Reviews from './pages/Reviews';
import JobHolderDashboard from './pages/JobHolderDashboard';
import EditJob from './pages/EditJob';
import { AuthProvider } from './context/AuthContext';
import PrivateRoute from './components/PrivateRoute';
import ErrorBoundary from './components/ErrorBoundary';
import { useTheme } from './context/ThemeContext';
import AdminDashboard from './pages/AdminDashboard';

function App() {
  const { darkMode } = useTheme();

  const theme = createTheme({
    palette: {
      mode: 'light',
      primary: {
        main: '#4A90E2',
        light: '#5C9CE5',
        dark: '#357ABD'
      },
      secondary: {
        main: '#67B26F',
        light: '#4ca2cd',
        dark: '#3f8f3f'
      },
      background: {
        default: '#f5f7fa',
        paper: '#ffffff'
      },
      text: {
        primary: '#2C3E50',
        secondary: '#7F8C8D'
      }
    },
    typography: {
      fontFamily: '"Poppins", "Roboto", "Helvetica", "Arial", sans-serif',
      h4: {
        fontWeight: 600,
        color: '#2C3E50'
      },
      h6: {
        fontWeight: 500
      }
    },
    components: {
      MuiButton: {
        styleOverrides: {
          root: {
            borderRadius: 8,
            textTransform: 'none',
            fontWeight: 500,
            padding: '8px 16px'
          },
          contained: {
            boxShadow: 'none',
            '&:hover': {
              boxShadow: '0 4px 12px rgba(0,0,0,0.1)'
            }
          }
        }
      },
      MuiPaper: {
        styleOverrides: {
          root: {
            backgroundImage: 'none'
          }
        }
      },
      MuiCard: {
        styleOverrides: {
          root: {
            backgroundColor: '#ffffff',
            backdropFilter: 'blur(10px)',
            transition: 'transform 0.3s ease, box-shadow 0.3s ease',
            '&:hover': {
              transform: 'translateY(-4px)',
              boxShadow: '0 12px 48px rgba(0, 0, 0, 0.12)'
            }
          }
        }
      }
    }
  });

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <ErrorBoundary>
        <AuthProvider>
          <BrowserRouter>
            <Navbar />
            <Routes>
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/admindashboard" element={<AdminDashboard />} />
              <Route path="/" element={<PrivateRoute><Home /></PrivateRoute>} />
              <Route path="/job/:id" element={<PrivateRoute><JobDetails /></PrivateRoute>} />
              <Route path="/job/:id/questions" element={<PrivateRoute><Questions /></PrivateRoute>} />
              <Route path="/job/:id/reviews" element={<PrivateRoute><Reviews /></PrivateRoute>} />
              <Route path="/jobholder/dashboard" element={<PrivateRoute><JobHolderDashboard /></PrivateRoute>} />
              <Route path="/job/:jobId/edit" element={<EditJob />} />
            </Routes>
          </BrowserRouter>
        </AuthProvider>
      </ErrorBoundary>
    </ThemeProvider>
  );
}

export default App;
